              "description": "This dataset is the databased part of the Araneae from the terrestrial arthopods collections of the Muséum national d'Histoire naturelle (Paris).\n\t\t\t\t\n\t\t\t\tThe spider collection of the Museum is amongst the most important in the world (along with those of London and New York). The specimens come from around the world. They are mainly preserved in 75% alcohol in glass jars with some preparations on microscope slides. All specimens whether or not the types are located in two places: a large general reserve of the Museum, the zoothÃ¨que, and a smaller reserve in a research building. About 26,000 species of spiders, some 12,000 types (mixed in the entire collection) are represented in the Museum. This represents a number of individuals estimated to be approximately 2 million. Started in the 1860s by EugÃ¨ne SIMON, the collection has grown significantly over the years with substantial collections in number of specimens (including a large part of the material remaining to be studied and identified) from other arachnologists or naturalists, among them Bonnet, Denis, Dresco Legendre or Strand ... This collection has a predominantly scientific vocation. It grows with some specimens to several hundred per year with donations mainly from current collections. The main domains of research activity related to this collection are systematic, with two major axes, taxonomy and biosystematics, but also applications in the management of biodiversity and the environment as well as expertise. The loan service of the collection is of great importance each year along with hosting of visitors and sending material. Databasing began in the 2000s. Are currently integrated into the general database of the Museum some 3,000 lots spiders. The sources of information related to this collection are also based on manual files easily available to visitors and on a library with historical reference books as well as most recent reprints.",
              "name": "The Araneae collection (AR) of the Muséum national d'Histoire naturelle (MNHN - Paris)",
