function transform(e) {
  let occ = e.occurrences?.documents?.results[0];
  return {
      title: e.collection.name,
      description: `From ${e.collection.institution.name}`,
      background: occ.primaryImage?.identifier,
      imageLicense: `[${occ.scientificName}](/specimen/search?entity=${occ.key})`,
      cta: [
          {
              text: 'More',
              href: `/collection/${e.key}`
          }
      ]
  }
}

